import React from 'react';
import "../Sidebar.css";
import SidebarOption from './SidebarOption';

function Sidebar() {
    return (
        <div className = "sidebar">
            <img className = "sidebar_logo" src = "http://getheavy.com/wp-content/uploads/2019/12/spotify2019-830x350.jpg" alt = "Spotify Icon"></img>
            <SidebarOption option="Home"/>
            <SidebarOption option="Search"/>
            <SidebarOption option="Your Library"/>
        </div>
    );
}

export default Sidebar;
